    r = [0] / (len(t) + 1)
    r[0] = 1
    dp = [r[:]]
    for c in s:
        r = r[:]
        for j in range(len(t)):
            r[j + 1] += dp[-1][j] * (c == t[j] or c == '*')
        dp.append(r)
    return dp[-1][-1]

